import React from 'react'
import coverImage from "../../assets/images/portfolio_cover.png";


function Portfolio() {
  return (
    <section>
      <img src={coverImage} style={{ width: "100%" }} alt="cover" />
      <p></p>
    </section>
  );
}
export default Portfolio;
